import React from "react";
import ReactDOM, { render } from "react-dom";

function Test(){
    render(
        <div>
        <main>
            <h1>HELLO</h1>
        </main>
        </div>
    )
}

ReactDOM.render(<Test/>,document.getElementById("root"));
